import React from "react";
import "./App.css";
import DataTable from "../src/components/DataTable";
import DataSearch from "../src/components/DataSearch";

function App() {
  state = {
    data: []
  };
  getData = () => {
    axios
      .get("/search")
      .then(response => {
        this.setState({
          data: response
        });
      })
      .catch(err => {
        console.log(err);
      });
  };

  return (
    <div className="App">
      <h1>Alteos</h1>
      <DataSearch />
      <DataTable />
    </div>
  );
}

export default App;
